from typing import List, Tuple
import re


class Solution:
    def make_divisors(self, n):
        divisors = []
        for i in range(1, int(n ** 0.5) + 1):
            if n % i == 0:
                divisors.append(i)
                if i != n // i:
                    divisors.append(n // i)
        # divisors.sort()
        return divisors
    def countDifferentSubsequenceGCDs(self, nums: List[int]) -> int:
        ss = set()
        nums.sort(reverse=True)
        import math
        ss.add(1)
        for x in nums:
            for y in list(ss):
                z = math.gcd(x, y)
                ss.add(z)
            ss.add(x)
        return len(ss)


